INSERT INTO `contents` VALUES (1,'banner','Caring starts with Tiny Steps','banner-title',NULL,'2019-12-20 16:18:56'),(2,'banner','Sign up for free','banner-sign-up-title',NULL,'2019-12-20 16:18:56'),(3,'banner','<p>Registration does not imply any commitments</p>','banner-content',NULL,'2019-12-20 16:18:56'),(4,'banner','https://dev.tinysteps.nl/uploads/banner.png','banner-bg',NULL,'2019-12-20 15:36:43'),(5,'services','For nanny','services-title1',NULL,'2019-12-20 16:18:56'),(6,'services','https://dev.tinysteps.nl/uploads/nanny.png','services-image1',NULL,'2019-12-20 16:16:25'),(7,'services','<p>Share your skills and get hired.&nbsp;</p>','services-content1',NULL,'2019-12-20 16:18:56'),(8,'services','For parent','services-title2',NULL,'2019-12-20 16:18:56'),(9,'services','https://dev.tinysteps.nl/uploads/family.png','services-image2',NULL,'2019-12-20 16:16:25'),(10,'services','<p>Hire the best nanny for your family.&nbsp;</p>','services-content2',NULL,'2019-12-20 16:18:56'),(11,'services','For learners','services-title3',NULL,'2019-12-20 16:18:56'),(12,'services','https://dev.tinysteps.nl/uploads/program.png','services-image3',NULL,'2019-12-20 16:16:25'),(13,'services','<p>Learn about mindful parenting and child&rsquo;s growth &amp; development.&nbsp;</p>','services-content3',NULL,'2019-12-20 16:18:56'),(14,'how-it-works','How it works','how-it-works-title',NULL,'2019-12-20 16:18:56'),(15,'how-it-works','<p>Like your home, <em>Tiny Steps</em> makes the process of availing babysitting services easy, safe, and comfortable for you.&nbsp;</p>','how-it-works-content',NULL,'2019-12-20 16:18:56'),(16,'how-it-works','Step 1','how-it-works-col1-title',NULL,'2019-12-20 16:18:56'),(17,'how-it-works','https://dev.tinysteps.nl/uploads/step1.png','how-it-works-col1-img',NULL,'2019-12-20 16:14:18'),(18,'how-it-works','<p>Register online and complete your profile.&nbsp;</p>','how-it-works-col1-content',NULL,'2019-12-20 16:18:56'),(19,'how-it-works','Step 2','how-it-works-col2-title',NULL,'2019-12-20 16:18:56'),(20,'how-it-works','https://dev.tinysteps.nl/uploads/step2.png','how-it-works-col2-img',NULL,'2019-12-20 16:14:18'),(21,'how-it-works','<p>Find a babysitter (or babysitting jobs).&nbsp;</p>','how-it-works-col2-content',NULL,'2019-12-20 16:18:56'),(22,'how-it-works','Step 3','how-it-works-col3-title',NULL,'2019-12-20 16:18:56'),(23,'how-it-works','https://dev.tinysteps.nl/uploads/step3.png','how-it-works-col3-img',NULL,'2019-12-20 16:14:18'),(24,'how-it-works','<p>Send a message and set up an interview.&nbsp;</p>','how-it-works-col3-content',NULL,'2019-12-20 16:18:56'),(25,'how-it-works','Learn more','how-it-works-btn-text',NULL,'2019-12-20 16:18:56'),(26,'how-it-works','/how-it-works','how-it-works-btn-link',NULL,'2019-12-20 16:18:56'),(27,'cta-1st','<p>Come and join the Tiny Steps Community.</p>','cta-1st-title',NULL,'2019-12-20 16:18:56'),(28,'cta-1st','Register now','cta-1st-btn-text',NULL,'2019-12-20 16:18:56'),(29,'nannies-and-babysitters','Meet our nannies & babysitters','nannies-title',NULL,'2019-12-20 16:18:56'),(30,'nannies-and-babysitters','<p>Parenting does not have to be lonely and overwhelming. A community of nannies and babysitters is here to help and offer the best of babysitting in The Netherlands. Read their profiles and find the best match for your child.&nbsp;</p>','nannies-content',NULL,'2019-12-20 16:18:56'),(31,'testimonials','Why parents trust us','testi-title',NULL,'2019-12-20 16:18:56'),(32,'cta-2nd','<p>Choose the best babysitter for your child at home.</p>','cta-2nd-title',NULL,'2019-12-20 16:18:56'),(33,'cta-2nd','Register Now','cta-2nd-btn-text',NULL,'2019-12-20 16:18:56'),(34,'how-it-works-main','How it works','how-it-works-main-title',NULL,'2019-12-20 15:56:55'),(35,'how-it-works-main','<p>Like your home, Tiny Steps makes the process of availing nanny service in The Netherlands easy, safe, and comfortable for you.</p>\r\n<p>Find or be the best match for the child who deserves great care and attention.</p>','how-it-works-main-content',NULL,'2019-12-20 15:56:55'),(36,'for-nanny','For Nanny','for-nanny-title',NULL,'2019-12-20 15:56:55'),(37,'for-nanny','Step 1','for-nanny-col1-title',NULL,'2019-12-20 15:56:55'),(38,'for-nanny','https://dev.tinysteps.nl/uploads/step1.png','for-nanny-col1-image',NULL,'2019-12-20 15:55:10'),(39,'for-nanny','Register Online','for-nanny-col1-content-title',NULL,'2019-12-20 15:56:55'),(40,'for-nanny','<p>To register, click on Sign Up in the top right corner of the site.</p>\r\n<p>Fill out the &ldquo;choose your username&rdquo; box and then complete the rest of your profile.</p>\r\n<p>To offer the best babysitting services, be sure to indicate your strengths and activities that kids will love.</p>','for-nanny-col1-content',NULL,'2019-12-20 15:56:55'),(41,'for-nanny','Step 2','for-nanny-col2-title',NULL,'2019-12-20 15:56:55'),(42,'for-nanny','https://dev.tinysteps.nl/uploads/step2.png','for-nanny-col2-image',NULL,'2019-12-20 15:55:10'),(43,'for-nanny','Enter your search criteria & find the best babysitting job in your area','for-nanny-col2-content-title',NULL,'2019-12-20 15:56:55'),(44,'for-nanny','<p>You can select your preferred job criteria and find the best babysitting jobs in the area.</p>\r\n<p>When you view a family&rsquo;s profile, you will learn about their location, the number of kids, their age, and which days of the week they need a babysitter.&nbsp;</p>','for-nanny-col2-content',NULL,'2019-12-20 15:56:55'),(45,'for-nanny','Step 3','for-nanny-col3-title',NULL,'2019-12-20 15:56:55'),(46,'for-nanny','https://dev.tinysteps.nl/uploads/step3.png','for-nanny-col3-image',NULL,'2019-12-20 15:55:10'),(47,'for-nanny','Talk to them and set up an interview','for-nanny-col3-content-title',NULL,'2019-12-20 15:56:55'),(48,'for-nanny','<p>Found a family you&rsquo;d like to babysit for?</p>\r\n<p>You can instantly send them a message. (A premium membership allows you to send the first message.)</p>\r\n<p>If someone sends you the first message, it&rsquo;s always free to reply.</p>','for-nanny-col3-content',NULL,'2019-12-20 15:56:55'),(49,'for-parent','For Parent','for-parent-title',NULL,'2019-12-20 15:56:55'),(50,'for-parent','Step 1','for-parent-col1-title',NULL,'2019-12-20 15:56:55'),(51,'for-parent','https://dev.tinysteps.nl/uploads/step1.png','for-parent-col1-image',NULL,'2019-12-20 15:56:55'),(52,'for-parent','Register Online','for-parent-col1-content-title',NULL,'2019-12-20 15:56:55'),(53,'for-parent','<p>To register, click on Sign Up in the top right corner of the site.</p>\r\n<p>Fill out the &ldquo;choose your username&rdquo; box and then complete the rest of your profile.&nbsp;</p>','for-parent-col1-content',NULL,'2019-12-20 15:56:55'),(54,'for-parent','Step 2','for-parent-col2-title',NULL,'2019-12-20 15:56:55'),(55,'for-parent','https://dev.tinysteps.nl/uploads/step2.png','for-parent-col2-image',NULL,'2019-12-20 15:56:55'),(56,'for-parent','Enter your search criteria & find the best babysitting job in your area','for-parent-col2-content-title',NULL,'2019-12-20 15:56:55'),(57,'for-parent','<p>You can start searching for the babysitter near you and who meets your criteria. When you view a babysitter&rsquo;s profile, you will learn about their location, experience, skills, and availability.</p>\r\n<p>To enjoy the best nanny service in The Netherlands, make sure that the activities offered by the nanny or babysitter are compatible with your child&rsquo;s age and personality.</p>','for-parent-col2-content',NULL,'2019-12-20 15:56:55'),(58,'for-parent','Step 3','for-parent-col3-title',NULL,'2019-12-20 15:56:55'),(59,'for-parent','https://dev.tinysteps.nl/uploads/step3.png','for-parent-col3-image',NULL,'2019-12-20 15:56:55'),(60,'for-parent','Talk to them and set up an interview','for-parent-col3-content-title',NULL,'2019-12-20 15:56:55'),(61,'for-parent','<p>Found the perfect match for your family?</p>\r\n<p>You can instantly send them a message. (A premium membership allows you to send the first message.)</p>\r\n<p>If someone sends you the first message, it&rsquo;s always free to reply</p>','for-parent-col3-content',NULL,'2019-12-20 15:56:55'),(62,'how-it-works-cta1','<p>Come and join the Tiny Steps Community</p>','how-it-works-cta1-title',NULL,'2019-12-20 15:56:55'),(63,'how-it-works-cta1','Register now','how-it-works-cta1-btn-text',NULL,'2019-12-20 15:56:55'),(64,'program','Play Program','program-title',NULL,'2019-12-20 15:56:55'),(65,'program',NULL,'program-content',NULL,'2019-12-20 15:56:55'),(66,'program','https://dev.tinysteps.nl/uploads/program.png','program-image',NULL,'2019-12-20 15:56:55'),(67,'program','<p>Play is an important part of growing up and enables children to develop skills for life. It helps in children&rsquo;s physical development by enhancing their fine and gross motor skills and body awareness, developing cognitive skills by enhancing creativity, imagination, problem- solving, focus and concentration, boosting social competence and stimulating emotional maturity and strength by engaging and interacting in the world around them.</p>\r\n<p>Parental involvement in play is a vital component in the development and learning of children at all stages because the most creative children are those who have adult involvement in their play. Participation of parents and family members is the richest play rather than merely providing toys and supervising them while playing. It helps connect family members. We in Happy Steps encourage parents, family member, nannies and babysitters to be actively involved in playing with children.</p>','program-content2',NULL,'2019-12-20 15:56:55'),(68,'program','Contact us','program-btn-text',NULL,'2019-12-20 15:56:55'),(69,'program','/contact','program-btn-link',NULL,'2019-12-20 15:56:55'),(70,'benefits','Benefits','benefits-title',NULL,'2019-12-20 15:56:55'),(71,'benefits','Play is vital for enhancing healthy brain development.','benefits-list1',NULL,'2019-12-20 15:56:55'),(72,'benefits','Play helps develop cognitive and language skills.','benefits-list2',NULL,'2019-12-20 15:56:55'),(73,'benefits','Play boosts physical development.','benefits-list3',NULL,'2019-12-20 15:56:55'),(74,'benefits','Play stimulates creativity and imagination.','benefits-list4',NULL,'2019-12-20 15:56:55'),(75,'benefits','Play promotes socio-emotional skills.','benefits-list5',NULL,'2019-12-20 15:56:55'),(76,'how-it-works-cta2','<p>Come and join the Happy Steps Family!</p>','how-it-works-cta2-title',NULL,'2019-12-20 15:56:55'),(77,'how-it-works-cta2','Register now','how-it-works-cta2-btn-text',NULL,'2019-12-20 15:56:55'),(78,'faq-main','Frequently Asked Questions (FAQs)','faq-main-title',NULL,'2020-01-19 13:26:47'),(79,'faq-main','<p>Got questions about using the platform of <em>Tiny Steps</em>?</p>\r\n<p>Browse through our FAQs.</p>','faq-main-content',NULL,'2020-01-19 13:26:47'),(80,'faq-cta','<p>Can&rsquo;t find the answer to your question?</p>','faq-cta-title',NULL,'2020-01-19 13:26:47'),(81,'faq-cta','Contact us','faq-cta-btn-text',NULL,'2020-01-19 13:26:47'),(82,'faq-cta','/contact','faq-cta-btn-link',NULL,'2020-01-19 13:26:47'),(83,'blog-main','Written with love and attention by the Tiny Steps Family','blog-main-title',NULL,'2019-12-17 12:47:39'),(84,'blog-main','<p>Whether you are looking for nanny care or babysitting jobs, you have a community here who can listen, support, and guide you. With the in-house specialists of Tiny Steps behind us, we can learn more about child development, mindful parenting, babysitting, and everything related to family life with ease and confidence.</p>','blog-main-content',NULL,'2019-12-17 12:47:39'),(85,'blog-filter','Show Articles:','blog-filter-text',NULL,'2019-12-17 12:47:39'),(86,'about-us','Our Commitment','about-us-title',NULL,'2019-12-20 16:09:41'),(87,'about-us','<h4 style=\"text-align: center;\">Being a parent is tough. Leaving your child at home is tougher.</h4>\r\n<p>There might be a daycare or a babysitter nearby, but you still feel anxious; wondering if your kids are having fun and at the same time, getting the care and attention they deserve. Here at Tiny Steps, we will help you find a nanny that would fit your child&rsquo;s needs. Tiny Steps connects skilled and dedicated nannies to expat and local families with specific needs and challenges. Consider us your second home. Whether you&rsquo;re a parent or a nanny looking to offer your services, our website provides you a space to share your stories, talents, skills, and desired activities.</p>\r\n<p>This makes it easier and safer for everyone to find their best match. Outside of our nanny-matching service, we also develop programs that encourage mindfulness, awareness, and involvement in all stages of a child&rsquo;s development. We believe that children are only children once. Let&rsquo;s make the most of this time&mdash;together!</p>','about-us-content',NULL,'2019-12-20 16:09:41'),(88,'mission','Our Purpose','mission-title',NULL,'2019-12-20 16:09:41'),(89,'mission','https://dev.tinysteps.nl/uploads/mission-img.png','mission-image',NULL,'2019-12-20 15:50:22'),(90,'mission','<p>Here at Tiny Steps, we believe that hiring the right nanny or babysitter makes all the difference. Parents should feel assured that their kids receive the learning tools, activities, and attention needed in the crucial stages of development. With the help of our mindful childcare specialists, Tiny Steps equips families and childcarers with knowledge and guidance to navigate their children&rsquo;s Ages &amp; Stages, celebrating these milestones with a holistic and mindful approach.</p>\r\n<p>&nbsp;</p>','mission-content',NULL,'2019-12-20 16:09:41'),(91,'vision','Our Intention','vision-title',NULL,'2019-12-20 16:09:41'),(92,'vision','https://dev.tinysteps.nl/uploads/GP3.jpg','vision-image',NULL,'2019-12-20 16:09:41'),(93,'vision','<p>At Tiny Steps, we go beyond providing babysitting jobs and nanny services for expats and local families. We advocate personalized childcare that is accessible, enjoyable, and safe. We adopt the principle of mindful parenting wherein our wish is for children to thrive and reach their fullest potentials by nurturing not only their minds but also instilling kindness, patience and compassion in their hearts.&nbsp;</p>\r\n<p>We have several stories and diverse backgrounds as families and childcare providers. But when it comes to raising children, a collective goal unites us: to see our kids grow healthy, smart, and loving individuals with unique aspirations.</p>','vision-content',NULL,'2019-12-20 16:09:41'),(94,'about-us-text-row','Who We Are','about-us-text-row-heading',NULL,'2019-12-20 16:09:41'),(95,'about-us-text-row','<p style=\"text-align: center;\">We are specialists in our fields, but we are parents first.</p>','about-us-text-row-content',NULL,'2019-12-20 16:09:41'),(96,'awards','Awards and Certifications','awards-title',NULL,'2019-12-20 16:09:41'),(97,'about-us-cta','<p>Come and join the Tiny Steps Family!</p>','about-us-cta-title',NULL,'2019-12-20 16:09:41'),(98,'about-us-cta','Register now','about-us-cta-btn-text',NULL,'2019-12-20 16:09:41'),(99,'contact-us-main','How can we help you today?','contact-us-main-title',NULL,'2019-12-20 15:52:53'),(100,'contact-us-main','<p>We&rsquo;d love to hear from you. We can tell you about mindful parenting, child development, babysitting services, and more!&nbsp;</p>','contact-us-main-content',NULL,'2019-12-20 15:52:53'),(101,'form-and-image','https://dev.tinysteps.nl/uploads/contact-img.png','form-and-image-image',NULL,'2019-12-20 15:52:53'),(102,'form-and-image','info@tinysteps.nl','form-and-image-email',NULL,'2019-12-20 15:52:53'),(103,'form-and-image','Chamber of Commerce: 67052096','form-and-image-coc-num',NULL,'2019-12-20 15:52:53'),(104,'form-and-image','Follow Us','form-and-image-social-title',NULL,'2019-12-20 15:52:53'),(105,'form-and-image','Get in Touch','form-and-image-form-title',NULL,'2019-12-20 15:52:53'),(106,'form-and-image','<p>To send your questions about parenting or nanny services, kindly fill out the form below.</p>','form-and-image-form-intro',NULL,'2019-12-20 15:52:53'),(107,'contact-us-cta','<p>Come and join the Tiny Steps Community.</p>','contact-us-cta-title',NULL,'2019-12-20 15:52:53'),(108,'contact-us-cta','Register now','contact-us-cta-btn-text',NULL,'2019-12-20 15:52:53'),(109,'terms-of-service','Terms of Service Page','tos-heading',NULL,'2019-12-17 12:58:03'),(110,'terms-of-service','<p>Please read these Terms &amp; Conditions before you use the Website, Services, and any other properties online of Tiny Steps to maintain proper Usage and legal compliance.&nbsp;</p>\r\n<h3>I. Purpose&nbsp;</h3>\r\n<p>Tiny Steps (&ldquo;we&rdquo;) acknowledges and respects the rights, capabilities, and decision of its User (&ldquo;you&rdquo;) as he/she navigates the Website and avails our Services. By using the Website, the User automatically:</p>\r\n<ul>\r\n<li>agrees to abide by these Terms &amp; Conditions at all times;</li>\r\n<li>agrees to review these Terms &amp; Conditions regularly as this may change at any time without prior notice and fully accept the changes;</li>\r\n<li>acknowledges that Users have no rights to sell, claim license to, or use any Content owned by Tiny Steps in illegal activities or actions beyond the online Usage set under these Terms &amp; Conditions and other Policies on the Website</li>\r\n</ul>\r\n<p>Should you deem any of these Terms &amp; Conditions inapplicable to you, please do not proceed with using the Website or registering an Account with us until you are ready to fully recognize and abide by all the Policies stipulated under these Terms &amp; Conditions.&nbsp;</p>\r\n<h3>II. Definitions</h3>\r\n<p>The following terms are used throughout these Terms &amp; Conditions, and each has a specific meaning regardless if they are in their singular or plural form:</p>\r\n<p><strong>Account</strong> &ndash; a registered Account or Premium Account with Tiny Steps, processed through the Website, and comes with an email address, username, and a password provided by the User</p>\r\n<p><strong>Babysitter</strong> &ndash; a category of a User on the Website that refers to an Individual who provides care for babies and children; a Babysitter with a registered Account on the Website can access certain Data, Services, and Content on the Website</p>\r\n<p><strong>Company</strong> &ndash; refers to Tiny Steps&nbsp;</p>\r\n<p><strong>Content</strong> &ndash; any material found on the Website (images, text, links) that are provided by Tiny Steps and its Users unless otherwise stated</p>\r\n<p><strong>Customer</strong> &ndash; refers to a Babysitter, Nanny, Parent, Family, Family Member, or any Individual who registers an account on the Website, visits the Website, expresses interest in Tiny Steps&rsquo; Services, has inquired about or availed its Services in the past, has attempted to register an Account on the Website, or has agreed to any form of subscription to the Website</p>\r\n<p><strong>Data</strong> &ndash; any type of information supplied by the Customer that are important in Website Usage and availing Tiny Step&rsquo;s Services</p>\r\n<p><strong>Database</strong> &ndash; a collection of Data provided by the Customer and the Company; well curated to help Users achieve satisfactory Profile matching</p>\r\n<p><strong>Family or Family Member</strong> &ndash; an Individual or group of Individuals who visit the Website or register an Account on the Website and seek childcare services</p>\r\n<p><strong>Fee (or Subscription Fee)</strong> &ndash; any fees payable to the Company for availing Tiny Steps&rsquo; Services and/or Website Usage as advertised on the Website and/or agreed by both Parties&nbsp;</p>\r\n<p><strong>Individual</strong> &ndash; a person who registers an account on the Website, visits the Website, expresses interest in Tiny Steps&rsquo; Services, has inquired about or availed its Services in the past, has attempted to register an Account on the Website, or has agreed to any form of subscription to the Website</p>\r\n<p><strong>Inactive Account</strong> &ndash; when Users opt to discontinue showing their Profile and temporarily refrain from using the Website instead of deleting their Account</p>\r\n<p><strong>Nanny</strong> &ndash; a category of a User on the Website that refers to an Individual who provides care for babies and children; a Nanny with a registered Account on the Website can access certain Data, Services, and Content on the Website</p>\r\n<p><strong>Login</strong> <strong>Details</strong> &ndash; refer to the credentials (username, email address, and password) supplied by the User to access and use Tiny Steps&rsquo; Website&nbsp;</p>\r\n<p><strong>Message</strong> &ndash; any form of communication sent by a User to another User</p>\r\n<p><strong>Parent</strong> &ndash; see Customer</p>\r\n<p><strong>Parties</strong> &ndash; refer to the Customer and the Company</p>\r\n<p><strong>Payment</strong> <strong>Period</strong> &ndash; fixed period in which the Subscription Fee applies</p>\r\n<p><strong>Policy</strong> &ndash; rules set by the Company that pertain to the Usage of their Website and can be found hereof or on other pages of the Website&nbsp;</p>\r\n<p><strong>Premium</strong> <strong>Account</strong> &ndash; see &ldquo;III. Services&rdquo; below</p>\r\n<p><strong>Privacy</strong> <strong>Policy</strong> &ndash; see Privacy Policy [insert link to Privacy Policy]</p>\r\n<p><strong>Profile</strong> &ndash; Data provided by Users for identification, compliance with the Website&rsquo;s requirements, and other purposes it may serve for availing Tiny Steps&rsquo; Services</p>\r\n<p><strong>Services</strong> &ndash; see &ldquo;III. Services&rdquo; below</p>\r\n<p><strong>Sole</strong> <strong>Authority</strong> &ndash; refers to an act, responsibility, or role that a User performs without external influence and takes full responsibility of</p>\r\n<p><strong>Terms</strong> <strong>&amp;</strong> <strong>Conditions</strong> - the terms and conditions of using the Website as updated from time to time and without prior notice</p>\r\n<p><strong>Tiny</strong> <strong>Steps</strong> - the Company that owns and operates the website [URL]</p>\r\n<p><strong>Usage</strong> &ndash; refers to accessing or using Tiny Steps&rsquo; Services and Website and covers the registration of an Account, reading or interacting with all types of Content, and performing any other legal activities on the Website that are acknowledged by Tiny Steps, these Terms &amp; Conditions, and applicable laws;</p>\r\n<p><strong>User</strong> &ndash; see Customer</p>\r\n<p><strong>Website</strong> &ndash; the digital platform of Tiny Steps that contains and runs its Services; covers all types of text, visual content, and elements found at [URL]</p>\r\n<h3>III. Services</h3>\r\n<p><strong>Website Usage.</strong>&nbsp;Tiny Steps&rsquo; Website is a platform where Individuals seeking childcare assistance from Nannies and Babysitters or Nannies and Babysitters looking for Parents or Families in need of childcare assistance can connect. In this community, Tiny Steps allows Users to create a Profile, which can be viewed by other Users, and contact other Users whose Profiles match their needs.</p>\r\n<p><strong>Roles of Users.</strong> Users are granted the Sole Authority to:</p>\r\n<ul>\r\n<li>form their own opinion when creating or viewing Profiles;</li>\r\n<li>assess the quality of Profiles and Users;</li>\r\n<li>select Users to hire or search for jobs on their own pace and preference;</li>\r\n<li>contact other Users to ask questions or hire them;</li>\r\n<li>set a meeting, schedule, financial agreements, and other necessary information regarding childcare services;</li>\r\n<li>make decisions throughout the inquiry or hiring phase, and such decisions will be acknowledged by all Parties as long as those decisions are acted upon according to these Terms &amp; Conditions and applicable laws;</li>\r\n<li>manage the creation, fulfillment, and termination of any type of agreement made between the Users whether on the Website or beyond it.</li>\r\n</ul>\r\n<p>Users are responsible for all matters, decisions, and activities arising from their use of their Account and the Website. Users also assume full responsibility for compliance with the Terms &amp; Conditions and applicable laws governing the use of the Website.</p>\r\n<p><strong>Accounts.</strong>&nbsp;Users who registered an Account on the Website can automatically enjoy free services such as registration on the Website, completion of Profiles, and access to the Database of Nannies, Babysitters, Parents, and Families.&nbsp;</p>\r\n<p>Users who upgrade their Account to a Premium Account can instantly send other Users a Message to start a conversation. This Fee, which applies for a Payment Period, is non-refundable.&nbsp;</p>\r\n<p><strong>Payment.</strong>&nbsp; Users can pay through iDEAL or Credit Card.</p>\r\n<p>Should a User fail to fulfill his or her payment obligations within the due date, the Premium subscription will be cancelled.&nbsp;</p>\r\n<p><strong>Cancellations and Refunds.</strong> If Users wish to cancel their Premium Account and to no longer use Tiny Steps&rsquo; Services, Users have the option to completely delete their Account.&nbsp;</p>\r\n<p>If Users want to discontinue displaying their Profiles and temporarily refrain from using the Website but not completely remove their Account from the Website, Users can switch to Inactive Account instead. Users with Inactive Accounts are not required to pay any Subscription Fee but are responsible for completing their payment for the last Payment Period wherein a Subscription Fee applies. Inactive Accounts can be reactivated when the User logged in again on the Website.</p>\r\n<p>Refunds will not apply in the following situations:</p>\r\n<ul>\r\n<li>When a User cancels an Account or switches to Inactive Account within a Payment Period;</li>\r\n<li>When the Website undergoes system maintenance to improve its Services, features, and facilities for Users;</li>\r\n<li>Any interruptions, damages, or dissatisfactory experienced by Users following their decision to contact or engage with other Individuals they initially connected with on the Website.</li>\r\n</ul>\r\n<p><strong>Other Policies.</strong> Users can find other Policies pertaining to Website Usage and availing of Services on the other pages of the Websites, including but not limited to the method and requirements in the completion of Profiles and registration and upgrading of Accounts.</p>\r\n<h3>IV. Condition of Use</h3>\r\n<p><strong>Access to Database.</strong> Users exercise a revocable access to the Database and the opportunity to share their Profiles for job search and hiring activities that are held in accordance with these Terms &amp; Conditions and as may be allowed by law. The Website should not be used for purposes not stated in these Terms &amp; Conditions.&nbsp;</p>\r\n<p><strong>Creation of Accounts and Profiles.</strong> By creating an Account on the Website, Users agree that the Data they provided are existing, up-to-date, legally binding, and accurate. Users are responsible for maintaining the confidentiality of their Login Details whether on the website or mobile and for ensuring that they have read, understood, and accepted Tiny Steps&rsquo; Privacy Policy. Users are encouraged to create strong passwords and not share it to other Users or entities outside the Website. Users are advised to log out after using the Website. By creating a Profile, Users confirm that the information they provided are current, legitimate, and truthful and authorize the Website to show their Profile to other Users.</p>\r\n<p>A User can only create one Account that matches his/her identity. A User is not allowed to create an Account for another identity. If you believe that your Login Details or Account may have been compromised, contact [email] so we can immediately assist you with your technical concerns.</p>\r\n<p><strong>Behavior &amp; Fair Use.</strong> Tiny Steps encourages Users to exercise professionalism, decorum, and transparency and to comply with the Terms &amp; Conditions and applicable laws when using the Website.&nbsp;</p>\r\n<p>As a part of a family-friendly community, you as a User agree to:</p>\r\n<ul>\r\n<li>not duplicate, disclose in public, resell, use for commercial purposes, or illegally make available to third parties any Data on the Website, including conversations between Users;</li>\r\n<li>not engage third parties to carry out any actions on the Website;</li>\r\n<li>not post, transmit, or send any information that is deemed harmful, illegal, defamatory, offensive, or inciting violent;</li>\r\n<li>not start, perform, or promote actions that constitute any financial, digital, or personal crimes;</li>\r\n<li>not create any situation, information, or material that can damage Tiny Steps&rsquo; trademark, logo, intellectual property, or Content;</li>\r\n<li>not use any tools, data mining, robots, or other software that can collect data to acquire information from the Database.</li>\r\n</ul>\r\n<p>Tiny Steps may remove a User from the Website, block access to the Database or any Account, cancel activities, delete Content, or act on a situation identified as non-compliance or violation.&nbsp;</p>\r\n<h3>V. System Upgrade, Repair, Or Maintenance&nbsp;</h3>\r\n<p>Tiny Steps aims to provide great service to its Customers. To fulfill this, the Website undergoes system upgrade, repair, or maintenance from time to time without prior notice. Users agree and acknowledge that should these activities take place and affect the Website&rsquo;s availability and Tiny Steps&rsquo; operations, the Company has no means of controlling the availability of its Services and shall not be liable for any interruptions to such.&nbsp;</p>\r\n<h3>VI. Liability &amp; Warranties</h3>\r\n<p>Users agree that risks such as information access, sharing, and transmission are inevitable on the Internet, and Tiny Steps has no absolute capacity to eradicate the said risks and shall not be held liable for the occurrence of the said risks and their consequences.</p>\r\n<p>Users are aware that they exercise their discretion to provide their information to the Website and use its Services according to their roles and these Terms &amp; Conditions. In this regard, Users agree that Tiny Steps has neither control nor liability for any type of damage, violation, negligence, financial loss, Data loss, disputes, and unlawful activities connected with or occurring as a result of the Usage of the Website. The restrictions named here are not applicable in the case of deliberate and/or conscious negligence on the part of Tiny Steps.&nbsp;</p>\r\n<p>Users agree that as Customers, they are responsible for being informed about their rights and how they can be exercised as provided under other applicable laws in relation to the Usage of the Website. Users have the right to report any damage or dispute that concerns Tiny Steps in writing. Users&rsquo; claim to compensation against the Company for any damage will lapse 12 months after the occurrence of the claim.&nbsp;</p>\r\n<h3>VII. Governing Law</h3>\r\n<p>The Dutch Law shall govern these Terms &amp; Conditions and your Usage of the Website. A recognized competent court in Amsterdam shall have jurisdiction in case of dispute.&nbsp;</p>\r\n<h3>VIII. Severability</h3>\r\n<p>Any provision of this Agreement that is prohibited or deemed unenforceable in any jurisdiction shall be ineffective to the extent of such prohibition or unenforceability without invalidating the remaining provisions hereof.</p>','tos-content',NULL,'2019-12-17 12:58:03'),(111,'privacy-policy','Privacy Policy','pp-heading',NULL,'2019-12-05 14:44:43'),(112,'privacy-policy','<p>Tiny Steps (&ldquo;we&rdquo;) respects the privacy of Users (&ldquo;you&rdquo;) as we build and sustain a community of Families and Babysitters. Our Privacy Policy shows how the Data you provide us is managed, stored, used, protected, or shared in connection with our system and your Usage of our Website and Services.</p>\r\n<p>By using Tiny Steps&rsquo; Website, you as a User automatically agree to abide by this Privacy Policy at all times. Users also agree that this Privacy Policy will be implemented in accordance with our declared purposes, our Terms &amp; Conditions, and the General Data Protection Regulation (GDPR) in Netherlands.</p>\r\n<h3>I. Scope</h3>\r\n<p>This Privacy Policy applies to the Users of Tiny Steps&rsquo; Website who may be referred to as Nannies, Babysitters, Families, and other Individuals. This Privacy Policy applies to Users who access the Website through any type of device, such as computer, mobile device, tablet, among others.</p>\r\n<h3>II. Definitions</h3>\r\n<p>This Privacy Policy adopts all the Policies as well as the definitions stated in <a href=\"../../../terms-of-service\">Tiny Steps&rsquo; Terms &amp; Conditions</a>. Below are additional definitions used in this Privacy Policy:</p>\r\n<p><strong>Collection</strong> &ndash; the process of acquiring Data from Users who agree to provide it as they use the Website and join Tiny Steps&rsquo; community</p>\r\n<p><strong>Data Controller</strong> &ndash; refers to Tiny Steps as the entity that processes the User&rsquo;s personal Data.</p>\r\n<p><strong>Data Subject</strong> - any User whose Data is collected by and provided to Tiny Steps through its Website</p>\r\n<p><strong>GDPR</strong> &ndash; General Data Protection Regulation (EU) 2016/679 is a regulation in EU law on data protection and privacy for all individual citizens of the European Union (EU) and the European Economic Area (EEA).</p>\r\n<h3>III. Collection of Information</h3>\r\n<p>Tiny Steps is committed to privacy and Data protection and collects your information based on a legitimate consent you have provided to us. As a User, you have the right to withdraw such information at any time by using the available features on the Website or by contacting Tiny Steps.</p>\r\n<p><strong>Basic Information</strong></p>\r\n<p>When a User registers an Account and creates his/her Profile on the Website, the User acknowledges and consents to the processing, collection, use, and storage of the following personal information:</p>\r\n<ul>\r\n<li>Full Name</li>\r\n<li>Date of Birth</li>\r\n<li>Email Address</li>\r\n<li>Phone/mobile Number</li>\r\n<li>Zip code and House Number</li>\r\n</ul>\r\n<p><strong>Profile</strong></p>\r\n<p>Having a complete Profile that showcases the skills and talents of Babysitters and Nannies helps them attract employers, receive inquiries, or get easily hired. For employers, their Profiles help them attract the ideal candidates they are looking for.</p>\r\n<p>Nannies and Babysitters are encouraged to provide the following information for their Profile:</p>\r\n<ul>\r\n<li>Previous / Current Employment</li>\r\n<li>Childcare Experience: Number of Years</li>\r\n<li>Experience with Age Categories of Children</li>\r\n<li>Relevant Skills and Talents You Can Share with Children</li>\r\n<li>Activities You Can Create or Stage for Children</li>\r\n<li>Maximum Number of Children You Are Capable to Babysit</li>\r\n<li>Certifications / Training</li>\r\n<li>Studying: Yes / No</li>\r\n<li>Languages Spoken</li>\r\n<li>Hourly Salary</li>\r\n</ul>\r\n<p>Parents are encouraged to provide the following information for their Profile:</p>\r\n<ul>\r\n<li>Number of Children</li>\r\n<li>Age of Children</li>\r\n<li>Gender of Children</li>\r\n<li>Expecting: Yes / No</li>\r\n<li>Expectations from the Nanny or Babysitter: Skills, Talents, Areas of Interest</li>\r\n<li>Hourly Salary</li>\r\n</ul>\r\n<p>Users can alter the information that they provide at any time. Users can also add other information to their Profile, such as a photo, professional awards or recognition, projects involvement, references, and other relevant qualifications. As stated in the Terms &amp; Conditions, Users have the sole authority to ask questions about the experience and credentials of other Users by sending them a Message.</p>\r\n<p>Users have control over the disclosure and accuracy of information they provide to the Website and to other Users. Users understand that the inclusion of untruthful information, omission of information, or withholding of information in their Profile or in any form of communication may affect the outcome or success of their job search and hiring as well as the overall User experience.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Content &amp; Communication</strong></p>\r\n<p>All types of Content that the User makes available on the Website will be accessed, processed, and stored by Tiny Steps. In case you disclose to the Website any personal Data that does not belong or relate to you, you agree that you are authorized to do such, have acquired consent from the owner of the Data about its disclosure to Tiny Steps and its Users, and that such Data can be treated as your own Data, which can be accessed, processed, and stored by Tiny Steps and are bound by the Privacy Policy as well.</p>\r\n<p>Any correspondence, Message, as well as feedback or suggestion you provide us over the Tiny Steps Website, email, or other online platforms will be treated as non-confidential information to the extent permitted by applicable laws. Users agree that Tiny Steps has the right to publish, use, or disseminate such communication without liability.</p>\r\n<p>Tiny Steps also collects automatically generated information, such as IP address, type of browser, computer system, and surfing behavior on the Website. Tiny Steps IT maintenance personnel as well as third party service providers the Company engages with may possess limited access to your Data, for the purposes of repair, bug fixes, maintenance, and restoration of the integrity of the Website&rsquo;s Database, servers, and your information and may be required to process your information according to the Privacy Policy and proper security measures.</p>\r\n<h3>IV. Purposes of Collection</h3>\r\n<p>Tiny Steps uses and processes your Data based on our capacity as a platform that aims to gather Families and Babysitters and creates a family-friendly environment where they can connect and communicate. Users agree and understand that the Data collected from them and any information they provided to Tiny Steps with expressed consent will be used to:</p>\r\n<ul>\r\n<li>maintain Website operations and functionality</li>\r\n<li>administer the Services of Tiny Steps</li>\r\n<li>improve overall User experience</li>\r\n<li>confirm the identities of Users</li>\r\n<li>provide Users exclusive access to the Database</li>\r\n<li>send Users information about Tiny Steps&rsquo; Services</li>\r\n<li>solicit feedback, suggestion, and other Messages</li>\r\n<li>process payments</li>\r\n<li>support marketing or statistical purposes</li>\r\n<li>provide information to third parties -- if you have provided permission, or if required by law or regulation&nbsp;</li>\r\n</ul>\r\n<h3>V. Data Protection</h3>\r\n<p>Tiny Steps will do its best to implement appropriate technical measures to protect the information you provide to us against any form of illegal activities.&nbsp;</p>\r\n<p>Users agree that the availability, accessibility, and storage of information outside Tiny Steps&rsquo; Website and platforms or wherein Tiny Steps is not a party to such arrangements, such as agreements made between Users or sharing the Data to other entities, are no longer under the control of Tiny Steps and not covered by this Privacy Policy.</p>\r\n<h3>VI. Rights &amp; Responsibilities of Data Subjects</h3>\r\n<p>You can view, remove, or change your personal details in your Profile any time. You may also request access and information about which details are stored about you or if there are details that must be changed.&nbsp;</p>\r\n<p>You may also make corrections or updates to your personal information.</p>\r\n<p>You can object to the processing of your personal information.</p>\r\n<p>You can get a restriction of processing once you spot inaccuracy in your personal Data, if you find the processing unlawful, or if you believe Tiny Steps no longer needs the Data you provided for the purposes of processing.&nbsp;&nbsp;</p>\r\n<p>You can access your personal Data in an orderly manner and machine-readable format and have the right to share or transmit such Data to another controller.</p>\r\n<h3>VII. Amendments &amp; Questions</h3>\r\n<p>This Privacy Policy may be modified by Tiny Steps at any time without prior notice. Relevant changes will be made available on this page or communicated through other Tiny Steps channels. Should you find any part of this Privacy Policy disagreeable or inapplicable to you, please do not proceed with creating an Account on the Website.&nbsp;</p>\r\n<p>Users can send questions and learn more about the Privacy Policy and how they can exercise their rights as Data Subjects by emailing Tiny Steps at [insert email]</p>','pp-content',NULL,'2019-12-05 14:44:43'),(113,'cookie-statement','Cookie Statement','cs-heading',NULL,'2019-12-05 15:00:52'),(114,'cookie-statement','<p><strong>What Are Cookies</strong></p>\r\n<p>As is common practice with almost all professional websites this site uses cookies, which are tiny files that are downloaded to your computer, to improve your experience. This page describes what information they gather, how we use it and why we sometimes need to store these cookies. We will also share how you can prevent these cookies from being stored however this may downgrade or \'break\' certain elements of the sites functionality.</p>\r\n<p>For more general information on cookies see the Wikipedia article on HTTP Cookies.</p>\r\n<p><strong>How We Use Cookies</strong></p>\r\n<p>We use cookies for a variety of reasons detailed below. Unfortunately in most cases there are no industry standard options for disabling cookies without completely disabling the functionality and features they add to this site. It is recommended that you leave on all cookies if you are not sure whether you need them or not in case they are used to provide a service that you use.</p>\r\n<p><strong>Disabling Cookies</strong></p>\r\n<p>You can prevent the setting of cookies by adjusting the settings on your browser (see your browser Help for how to do this). Be aware that disabling cookies will affect the functionality of this and many other websites that you visit. Disabling cookies will usually result in also disabling certain functionality and features of the this site. Therefore it is recommended that you do not disable cookies.</p>\r\n<p><strong>The Cookies We Set</strong></p>\r\n<ul>\r\n<li>\r\n<p>Account related cookies</p>\r\n<p>If you create an account with us then we will use cookies for the management of the signup process and general administration. These cookies will usually be deleted when you log out however in some cases they may remain afterwards to remember your site preferences when logged out.</p>\r\n</li>\r\n<li>\r\n<p>Login related cookies</p>\r\n<p>We use cookies when you are logged in so that we can remember this fact. This prevents you from having to log in every single time you visit a new page. These cookies are typically removed or cleared when you log out to ensure that you can only access restricted features and areas when logged in.</p>\r\n</li>\r\n<li>\r\n<p>Email newsletters related cookies</p>\r\n<p>This site offers newsletter or email subscription services and cookies may be used to remember if you are already registered and whether to show certain notifications which might only be valid to subscribed/unsubscribed users.</p>\r\n</li>\r\n<li>\r\n<p>Forms related cookies</p>\r\n<p>When you submit data to through a form such as those found on contact pages or comment forms cookies may be set to remember your user details for future correspondence.</p>\r\n</li>\r\n</ul>\r\n<p><strong>Third Party Cookies</strong></p>\r\n<p>In some special cases we also use cookies provided by trusted third parties. The following section details which third party cookies you might encounter through this site.</p>\r\n<ul>\r\n<li>\r\n<p>This site uses Google Analytics which is one of the most widespread and trusted analytics solution on the web for helping us to understand how you use the site and ways that we can improve your experience. These cookies may track things such as how long you spend on the site and the pages that you visit so we can continue to produce engaging content.</p>\r\n<p>For more information on Google Analytics cookies, see the official <a href=\"https://developers.google.com/analytics/devguides/collection/analyticsjs/cookie-usage\" target=\"_blank\" rel=\"noopener\">Google Analytics page</a>.</p>\r\n</li>\r\n</ul>\r\n<p><strong>More Information</strong></p>\r\n<p>Hopefully that has clarified things for you and as was previously mentioned if there is something that you aren\'t sure whether you need or not it\'s usually safer to leave cookies enabled in case it does interact with one of the features you use on our site.</p>\r\n<p>However if you are still looking for more information then you can contact us through one of our preferred contact methods:</p>\r\n<ul>\r\n<li>Email: info@tinysteps.nl</li>\r\n</ul>','cs-content',NULL,'2019-12-05 15:00:52'),(115,'thank-you','Thank you!','ty-heading',NULL,'2019-12-27 14:09:36'),(116,'thank-you','<p style=\"text-align: center;\"><span style=\"font-size: 24pt;\">Thank you for the registration.</span></p>','ty-content',NULL,'2019-12-27 14:09:36'),(117,'thank-you',NULL,'ty-background',NULL,NULL),(118,'thank-you',NULL,'ty-cta-btn-text',NULL,'2019-12-27 14:09:36');
