INSERT INTO `faqs` VALUES (6,'For Parent','What does Tiny Steps cost?','You can always sign up or register for free. Receiving and replying to messages is also free. However, if you found the perfect match and you want to send the first message, you may then apply for premium membership.','2019-12-18 13:14:49','2020-01-19 11:56:21'),(7,'For Parent','How much is premium membership?','Parents can enjoy premium membership for ....per month and ....per three months.','2019-12-18 13:19:42','2019-12-18 13:19:42'),(8,'For Parent','How much does it cost to hire a nanny or a babysitter?','Nanny or babysitting rates depend on the credentials and location of the childcarer.  You may check these criteria as you screen the profiles on our website.  You can use the minimum wage as your reference.  You should also consider the babysitter\'s relevant experience, other tasks you want them to accomplish, and the length of service.','2019-12-18 13:25:06','2019-12-18 13:25:06'),(9,'For Parent','How do I hire a nanny or babysitter online?','At Tiny Steps, we make it easy and simple for you.  See How It Works. [link]\r\nAnd to find the best match for you, come up with your criteria first so you have a basis when screening profiles.  A few questions to ask yourself during the process; What are the qualities am I looking for in a babysitter?  Does the babysitter have a relevant experience?  Can the nanny or babysitter offer activities that my kids will love? Here are some helpful tips for finding the perfect nanny or babysitter [link]','2019-12-18 13:40:33','2020-01-22 11:20:40'),(10,'For Parent','How do I interview a nanny or a babysitter?','We suggest that the questions to ask a nanny or a babysitter during an interview should be based first on your child\'s needs.  What are the activities your child will benefit from?  Is the babysitter capable of leading these activities for your child?\r\n\r\nThen, you can ask about the babysitter\'s experience, passion for kids, schedule, and fees.  Interviews also allow you to see the personality of the babysitter and if you\'re a good fit together.  This interview checklist may serve as a guide [link].','2019-12-18 13:45:37','2020-01-22 11:24:54'),(23,'For Nanny','What does Tiny Steps cost?','You can always sign up or register for free. Receiving and replying to messages is also free. However, if you found the perfect match and you want to send the first message, you may then apply for premium membership.','2019-12-20 16:26:37','2020-01-19 11:16:33'),(24,'About Tiny Steps','What is Tiny Steps?','Tiny Steps is a nanny-matching service platform founded on the principle of mindful parenting. With the help of our mindful childcare specialists, Tiny Steps equips families and childcarers with knowledge and guidance to navigate their children’s Ages & Stages with a holistic and mindful approach.','2019-12-20 16:27:13','2020-01-20 07:44:19'),(26,'For Nanny','How much is premium membership?','Nannies and babysitters can enjoy premium membership benefits for € per month.','2020-01-19 11:20:19','2020-01-19 11:20:19'),(27,'For Nanny','How much is a babysitter’s or a nanny’s salary?','We encourage you to charge by experience level and consider the number of kids you will babysit, the other tasks you will do for the family, and even your location. For new babysitters, you may start with the minimum wage and gradually increase it as you gain more experience. You may ask for additional payment if you will also perform household chores and other tasks that are not indicated in your initial agreement.','2020-01-19 11:22:17','2020-01-19 11:22:17'),(28,'For Nanny','What do I need to prepare for an interview?','Be ready to answer questions about yourself, your experience, why you want the job, and why parents should trust you with their kids. As long as you know and love what you’re doing, you can be yourself and give your best.\r\nNote that you’re not required to submit a CV or a cover letter. After registering on the website, you can build your profile to showcase your skills and experience. Here are tips on what you need to prepare for a nanny job application and interview. [link]','2020-01-19 11:27:41','2020-01-19 11:41:39'),(29,'For Nanny','What if I don’t have an experience yet as a babysitter?','While it’s true that parents will prefer experienced nannies and babysitters, remember that everyone goes through a first time. Even the veterans had to start somewhere. Even your clients became first time parents.\r\nAs a new babysitter, you can focus on finding ways to  gain more skills and experience. For example, you can ask your neighbors or relatives if you can babysit for them. You can offer assistance to them with taking care of the kids. To learn more about child development and babysitting, read the articles on Tiny Steps’ blog. [link]','2020-01-19 11:30:23','2020-01-20 11:35:25'),(30,'For Nanny','How can I get a babysitting job?','At Tiny Steps, we make the process easy and simple for you. See How It Works. [link]\r\nThen, review your profile. Make sure all the items are complete. Share your story, skills, and why you want to babysit. See if your availability matches the times most families need a babysitter. Lastly, upload a nice photo. A sincere, big smile makes you look easy to approach.','2020-01-19 11:32:54','2020-01-19 11:32:54'),(32,'About Tiny Steps','What are the costs and requirements when registering with Tiny Steps?','Your registration is free. Once your registration has been approved, you only need to complete your Profile and Account settings.  As a registered member, you have an option to avail premium membership with a subscription fee.','2020-01-19 12:40:19','2020-01-19 12:40:19'),(33,'About Tiny Steps','Does Tiny Steps screen parents and childcare providers?','Tiny Steps does not do screening or vetting for the parents and childcare providers.  Tiny Steps encourages parents and childcarers to complete their Profiles so other members can easily find them and evaluate if they are a great match. Parents and childcarers have the freedom to browse, screen, and choose the ones that match what they are looking for. Parents and childcarers can also send messages to one another and set up their initial meeting to see if they are a good fit together.','2020-01-19 12:51:19','2020-01-19 12:51:19'),(34,'Account and Privacy','How can I change my password?','Once you’re logged in, go to your Profile. Click on your name at the upper right side of the screen and choose Account Settings. Fill out the New Password box and then click the Update Account button.','2020-01-19 12:58:28','2020-01-19 12:58:28'),(35,'About Tiny Steps','What is Mindfulness and Mindful Parenting?','Tiny Steps highly advocate Mindful Parenting.  Mindfulness is the practice of bringing awareness to the present moment.  Mindful Parenting is when we think highly about the experience of childhood and have the space to give empathy by seeing the world through a child\'s eyes.  Parents learn how to deeply appreciate and nurture their children\'s innate capacity to be present in each moment.  Through Mindful Parenting, both parents and children learn the art of living in the now, appreciation, understanding, patience, kindness and compassion which leads to a harmonious and loving family.','2020-01-20 09:57:46','2020-01-22 12:00:05'),(36,'Account and Privacy','How can I edit my Profile?','Log in, go to your Profile, and click the Edit Profile button near the bottom of the page. After you’ve edited your Profile, click the Update Profile button.','2020-01-20 10:08:36','2020-01-20 10:08:36'),(37,'Account and Privacy','I have not received an email after I requested a new password. What should I do?','If you have not received the email that contains the reset password link yet, check your spam folder first. If the email is still not there, you may contact us at info@tinysteps.nl.','2020-01-20 10:14:32','2020-01-20 10:14:50'),(38,'Account and Privacy','How can I cancel my Premium Membership?','Log in, go to Account Settings, and click','2020-01-20 10:27:55','2020-01-20 10:27:55'),(39,'Account and Privacy','Can I cancel my account at Tiny Steps?','If you wish to cancel your account and no longer use Tiny Steps’ Services, you can completely do so by logging in, going to Account Settings, and clicking ‘Delete account’. A pop-up message asking you to confirm the deletion of your account will appear; click the Delete button.\r\n \r\nHowever, if you only wish to discontinue displaying your Profile and not appear in searches but not have it completely removed from the system, you can click ‘Deactivate account’ only. Your account would automatically be activated when you log in again.\r\n \r\nImportant Note for Premium Members: Your Premium subscription will automatically be terminated should you decide to delete or deactivate your account.','2020-01-20 10:52:13','2020-01-20 10:52:13'),(40,'Account and Privacy','How can I contact Tiny Steps?','You may email us at info@tinysteps.nl','2020-01-20 10:55:25','2020-01-20 10:55:25'),(41,'Account and Privacy','Can others see my personal data?','Your personal details such as full name, address and date of birth will be kept confidential and will never be shown on your Profile Page.  These vital information is safe with us and will never be shared or sold to third parties.','2020-01-20 11:09:43','2020-01-20 11:09:43'),(42,'Account and Privacy','What is my address used for?','Filling out your address will allow other parents or nannies to determine their distance and who is the nearest from your residence. This will help both of you arrange the details in your agreement, such as fees and schedule.','2020-01-20 11:17:01','2020-01-20 11:18:34'),(43,'Account and Privacy','Are my personal data secured?','Tiny Steps is committed to ensuring the safety and protection of your personal data. Our website is secured by an SSL-certificate, which safeguards pertinent information being sent out and received by the system.','2020-01-20 11:20:32','2020-01-20 11:20:32');
